import React, { Component } from 'react'
import styled from 'styled-components'
import ProjectCell from './projectCell'

const ProjectsContainer = styled.div`
  width: 100vw;
`
class Projects extends Component {
  render () {
    return (
      <ProjectsContainer>
        <ProjectCell/>
        <ProjectCell/>
        <ProjectCell/>
      </ProjectsContainer>
    )
  }
}

export default Projects
